metadata.description:
Applies a function to each member of a table and returns a table of the result.

```ballerina
table<record {|int id; int math; int physics;|}> students = table [
    {id: 1, math: 78, physics: 70},
    {id: 2, math: 83, physics: 80}
];
students.map(student => {id: student.id, avg: (student.math + student.physics) / 2}) ⇒ [{"id":1,"avg":74},{"id":2,"avg":81}]
```

Returns number of members of a table.

```ballerina
table<record {|string name;|}> students = table [
    {name: "Jo"},
    {name: "Smith"}
];
students.length() ⇒ 2
```

Returns an iterator over a table.

The iterator will iterate over the members of the table not the keys.
The `entries` function can be used to iterate over the keys and members together.
The `keys` function can be used to iterator over just the keys.

```ballerina
object {
    public isolated function next() returns record {|record {|string name;|} value;|}?;
} iterator = table [
    {name: "Jo"},
    {name: "Smith"}
].iterator();
iterator.next() ⇒ {"value":{"name":"Jo"}}
```

Returns the member of an table with a particular key.

This for use in a case where it is known that the table has a specific key,
and accordingly panics if parameter `t` does not have a member with key parameter `k`.

```ballerina
table<record {|readonly string index; string name;|}> key(index) students = table [
    {index: "220001CS", name: "Jo"},
    {index: "220002CS", name: "Sam"}
];
students.get("220002CS") ⇒ {"index":"220002CS","name":"Sam"}
students.get("110002CS") ⇒ panic
```

Adds a member to a table value, replacing any member with the same key value.

If parameter `val` replaces an existing member, it will have the same position
in the order of the members as the existing member;
otherwise, it will be added as the last member.
It panics if parameter `val` is inconsistent with the inherent type of parameter `t`.

```ballerina
table<record {|int id; string name;|}> employees = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
employees.put({id: 1, name: "Pat"});
employees ⇒ [{"id":1,"name":"Jo"},{"id":2,"name":"Sam"},{"id":1,"name":"Pat"}]
table<record {|readonly int id; string name;|}> key(id) students = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
students.put({id: 3, name: "Pat"});
students ⇒ [{"id":1,"name":"Jo"},{"id":2,"name":"Sam"},{"id":3,"name":"Pat"}]
students.put({id: 1, name: "Kane"});
students ⇒ [{"id":1,"name":"Kane"},{"id":2,"name":"Sam"},{"id":3,"name":"Pat"}]
table<record {readonly int id;}> key(id) studentIds = students;
studentIds.put({id: 7}) ⇒ panic
```

Adds a member to a table.

It will be added as the last member.
It panics if parameter `val` has the same key as an existing member of parameter `t`,
or if parameter `val` is inconsistent with the inherent type of `t`.

```ballerina
table<record {|int id; string name;|}> employees = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
employees.add({id: 1, name: "Pat"});
employees ⇒ [{"id":1,"name":"Jo"},{"id":2,"name":"Sam"},{"id":1,"name":"Pat"}]
table<record {|readonly int id; string name;|}> key(id) students = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
students.add({id: 3, name: "Pat"});
students ⇒ [{"id":1,"name":"Jo"},{"id":2,"name":"Sam"},{"id":3,"name":"Pat"}]
students.add({id: 1, name: "James"}) ⇒ panic
table<record {readonly int id;}> key(id) studentIds = students;
studentIds.add({id: 7}) ⇒ panic
```

Applies a function to each member of a table.

The parameter `func` is applied to each member of parameter `t`.

```ballerina
table<record {|string name; int salary;|}> employees = table [
    {name: "Jo", salary: 1200},
    {name: "Emma", salary: 800}
];
int total = 0;
employees.forEach(function(record {|string name; int salary;|} emp) {
    total += emp.salary;
});
total ⇒ 2000
```

Selects the members from a table for which a function returns true.

The resulting table will have the same keys as the argument table.

```ballerina
table<record {|int id; int salary;|}> employees = table [
    {id: 1, salary: 1200},
    {id: 2, salary: 1100},
    {id: 3, salary: 800}
];
employees.filter(emp => emp.salary < 1000) ⇒ [{"id":3,"salary":800}]
```

Removes a member of a table.

This removed the member of parameter `t` with key parameter `k` and returns it.
It panics if there is no such member.

```ballerina
table<record {|readonly int id; string name;|}> key(id) students = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
students.remove(1) ⇒ {"id":1,"name":"Jo"}
students ⇒ [{"id":2,"name":"Sam"}]
students.remove(5) ⇒ panic
```

Removes a member of a table with a given key, if the table has member with the key.

If parameter `t` has a member with key parameter `k`, it removes and returns it;
otherwise it returns `()`.

```ballerina
table<record {|readonly int id; string name;|}> key(id) students = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
students.removeIfHasKey(1) ⇒ {"id":1,"name":"Jo"}
students ⇒ [{"id":2,"name":"Sam"}]
students.removeIfHasKey(3) is () ⇒ true
```

Removes all members of a table.

This panics if any member cannot be removed.

```ballerina
table<record {|string name;|}> students = table [
    {name: "Jo"},
    {name: "Sam"}
];
students.removeAll() is () ⇒ true
students ⇒ []
table<record {|int score;|}> scores = <readonly> table [
    {score: 30},
    {score: 40}
];
scores.removeAll() ⇒ panic
```

Tests whether a table has a member with a particular key.

```ballerina
table<record {|readonly int id; string name;|}> key(id) students = table [
    {id: 1, name: "Jo"},
    {id: 2, name: "Sam"}
];
students.hasKey(1) ⇒ true
students.hasKey(5) ⇒ false
```

Returns a list of all the keys of a table.

```ballerina
table<record {|readonly string code; string name;|}> key(code) countries = table [
    {code: "CAN", name: "Canada"},
    {code: "DNK", name: "Denmark"},
    {code: "NPL", name: "Nepal"}
];
countries.keys() ⇒ ["CAN","DNK","NPL"]
```

Applies a function each member of a map and returns a map of the result.

The resulting map will have the same keys as the argument map.

```ballerina
map<int> marks = {"Carl": 85, "Bob": 50, "Max": 60};
marks.map(m => m > 50) ⇒ {"Carl":true,"Bob":false,"Max":true}
```

Returns an iterator over a map.

The iterator will iterate over the members of the map not the keys.
The function `entries` can be used to iterate over the keys and members together.
The function `keys` can be used to iterator over just the keys.

```ballerina
object {
    public isolated function next() returns record {|int value;|}?;
} iterator = {"Carl": 85, "Bob": 50, "Max": 60}.iterator();
iterator.next() ⇒ {"value":85}
```

Applies a function to each member of a map.

The parameter `func` is applied to each member of parameter `m`.

```ballerina
int total = 0;
{"Carl": 85, "Bob": 50, "Max": 60}.forEach(function (int m) {
    total += m;
});
total ⇒ 195
```

Selects the members from a map for which a function returns true.

```ballerina
map<int> marks = {"Carl": 85, "Bob": 50, "Max": 60};
marks.filter(m => m >= 60) ⇒ {"Carl":85,"Max":60}
```

Removes a member of a map with a given key, if the map has member with the key.

If parameter `m` has a member with key parameter `k`, it removes and returns it;
otherwise it returns `()`.

```ballerina
map<int> marks = {"Carl": 85, "Bob": 50, "Max": 60};
marks.removeIfHasKey("Carl") ⇒ 85
marks ⇒ {"Bob":50,"Max":60}
marks.removeIfHasKey("John") is () ⇒ true
```

Removes all members of a map.

This panics if any member cannot be removed.

```ballerina
map<int> marks = {"Carl": 85, "Bob": 50, "Max": 60};
marks.removeAll();
marks ⇒ {}
map<int> values = <record {|int x; int y;|}> {x: 10, y: 20};
values.removeAll() ⇒ panic;
```

Parse a CSV string as a subtype of `record {}[]` or `anydata[][]`.

```ballerina
string csvString = string `id,name
                           1,John
                           3,Jane`;
record {int id; string name;}[] csv1 = check csv:parseString(csvString);
[int, string][] csv2 = check csv:parseString(csvString);
record {|int id;|}[] csv3 = check csv:parseString(csvString);
record {int id;}[] csv4 = check csv:parseString(csvString, {skipLines: [1]});
```

Parse a byte[] as a subtype of `record {}[]` or `anydata[][]`.

```ballerina
byte[] csvBytes = check io:fileReadBytes("example.csv");
record {int id; string name;}[] csv1 = check csv:parseBytes(csvBytes);
[int, string][] csv2 = check csv:parseBytes(csvBytes);
record {|int id;|}[] csv3 = check csv:parseBytes(csvBytes);
record {int id;}[] csv4 = check csv:parseBytes(csvBytes, {skipLines: [1]});
```

Parse a CSV byte block stream as a subtype of `record {}[]` or `anydata[][]`.

```ballerina
stream<byte[], io:Error?> csvByteStream = check io:fileReadBlocksAsStream("example.csv");
record {int id; string name;}[] csv1 = check csv:parseStream(csvByteStream);
stream<byte[], io:Error?> csvByteStream2 = check io:fileReadBlocksAsStream("example.csv");
[int, string][] csv2 = check csv:parseStream(csvByteStream2);
stream<byte[], io:Error?> csvByteStream3 = check io:fileReadBlocksAsStream("example.csv");
record {|int id;|}[] csv3 = check csv:parseStream(csvByteStream3);
stream<byte[], io:Error?> csvByteStream4 = check io:fileReadBlocksAsStream("example.csv");
record {int id;}[] csv4 = check csv:parseStream(csvByteStream4, {skipLines: [1]});
```

Transform value of type record {}[] to subtype of `record {}[]` or `anydata[][]`.

```ballerina
record {int id; string name;}[] csvRecords = [{id: 1, name: "John"}, {id: 2, name: "Jane"}];
[int, string][] csv1 = check csv:transform(csvRecords);
record {|int id;|}[] csv2 = check csv:transform(csvRecords);
record {int id;}[] csv3 = check csv:transform(csvRecords, {skipLines: [1]});
```

Parse a string array of array as a subtype of `record {}[]` or `anydata[][]`.

```ballerina
string[][] csvList = [["1", "John"], ["2", "Jane"]];
[int, string][] csv1 = check csv:parseList(csvList);
record {|int id;|}[] csv2 = check csv:parseList(csvList, {customHeaders: ["id", "name"]});
record {int id;}[] csv3 = check csv:parseList(csvList, {skipLines: [1], customHeaders: ["id", "name"]});
```

Prints error logs.
```ballerina
error e = error("error occurred");
log:printError("error log with cause", 'error = e, id = 845315);
```

Set the log output to a file. Note that all the subsequent logs of the entire application will be written to this file.
```ballerina
var result = log:setOutputFile("./resources/myfile.log");
var result = log:setOutputFile("./resources/myfile.log", log:OVERWRITE);
```

Returns information about the current transaction.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:Info info = transaction:info();
        check commit;
    }
}
transactional function updateDB() {
    transaction:Info info = transaction:info();
    info.xid ⇒ [100,102,53,51,97,57,57,51,45]
}
```

Returns information about the transaction with the specified xid.

```ballerina
byte[] xid = [48, 53, 101, 102, 101, 55];
transaction:getInfo(xid) ⇒ {"xid":[48, 53, 101, 102, 101, 55],"retryNumber":0,"prevAttempt":null,"startTime":2022-12-20 16:03:37,228}
```

Prevents the global transaction from committing successfully.

This ask the transaction manager that when it makes the decision
whether to commit or rollback, it should decide to rollback.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:setRollbackOnly(error("marked as rollback only"));
        check commit;
    }
}
transactional function updateDB() {
    transaction:setRollbackOnly(error("marked as rollback only"));
}
```

Tells whether it is known that the transaction will be rolled back.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:setRollbackOnly(error("marked as rollback only"));
        transaction:getRollbackOnly() ⇒ true
        check commit;
    }
}
transactional function updateDB() {
    transaction:getRollbackOnly() ⇒ false
}
```

Associates some data with the current transaction branch.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:setData({accessType: "RO"});
        check commit;
    }
}
transactional function updateDB() {
    transaction:setData({accessType: "RO"});
}
```

Retrieves data associated with the current transaction branch.

The data is set using `setData`.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:setData({accessType: "RO"});
        transaction:getData() ⇒ {"accessType":"RO"}
        check commit;
    }
}
transactional function updateDB() {
    transaction:setData({accessType: "RO"});
    transaction:getData() ⇒ {"accessType":"RO"}
}
```

Adds a handler to be called if and when the global transaction commits.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:onCommit(onCommitHandle);
        check commit;
    }
}
transactional function updateDB() {
    transaction:onCommit(onCommitHandle);
}
isolated function onCommitHandle(transaction:Info info) {
    // Include the code to be executed when the transaction commits.
}
```

Adds a handler to be called if and when the global transaction rolls back.

```ballerina
function createEntity() returns error? {
    transaction {
        transaction:onRollback(onRollBackHandle);
        check commit;
    }
}
transactional function updateDB() {
    transaction:onRollback(onRollBackHandle);
}
isolated function onRollBackHandle(transaction:Info info, error? cause, boolean willRetry) {
    // Include the code to be executed when the transaction rollback.
}
```

Registers a listener object with a module.

The listener becomes a module listener of the module from which this
function is called.

```ballerina
runtime:DynamicListener ln = object {
    public function 'start() returns error? {}
    public function gracefulStop() returns error? {}
    public function immediateStop() returns error? {}
};
runtime:registerListener(ln);
```

Deregisters a listener from a module.

The `listener` ceases to be a module listener of the module from
which this function is called.

```ballerina
runtime:DynamicListener ln = object {
    public function 'start() returns error? {}
    public function gracefulStop() returns error? {}
    public function immediateStop() returns error? {}
};
runtime:deregisterListener(ln);
```

Applies a function to each member of a stream and returns a stream of the results.

```ballerina
stream<float> ms = [14.5f, 45.5f, 6.8f, 4f].toStream();
stream<float> cms = ms.map(m => m * 100.0);
cms.next() ⇒ {"value":1450.0}
```

Selects the members from a stream for which a function returns true.

```ballerina
stream<int> scores = [45, 60, 75, 30, 90].toStream();
scores.filter(score => score > 50).next() ⇒ {"value":60}
```

Returns the next element in the stream wrapped in a record or () if the stream ends.

```ballerina
stream<int> scores = [45, 60, 75, 30, 90].toStream();
scores.next() ⇒ {"value":45}
```

Applies a function to each member of a stream.

The parameter `func` is applied to each member of parameter `stm` stream in order.

```ballerina
stream<int> scores = [45, 60, 75, 30, 90].toStream();
int total = 0;
scores.forEach(function(int score) {
    total += score;
});
total ⇒ 300
```

Returns an iterator over a stream.

```ballerina
stream<int> scores = [45, 60, 75, 30, 90].toStream();
object {
    public isolated function next() returns record {|int value;|}?;
} iterator = scores.iterator();
iterator.next() ⇒ {"value":45}
```

Calculates the dot product of two float vectors.

```ballerina
float[] v1 = [1.0, 2.0, 3.0];
float[] v2 = [4.0, 5.0, 6.0];
dotProduct(v1, v2) ⇒ 32.0
```

Calculates the cosine similarity between two float vectors.

```ballerina
float[] v1 = [1.0, 2.0, 3.0];
float[] v2 = [4.0, 5.0, 6.0];
cosineSimilarity(v1, v2) ⇒ 0.9746318461970762
```

Calculates the Euclidean distance between two float vectors.

```ballerina
float[] v1 = [1.0, 2.0, 3.0];
float[] v2 = [4.0, 5.0, 6.0];
euclideanDistance(v1, v2) ⇒ 5.196152422706632
```

Calculates the Manhattan distance between two float vectors.

```ballerina
float[] v1 = [1.0, 2.0, 3.0];
float[] v2 = [4.0, 5.0, 6.0];
manhattanDistance(v1, v2) ⇒ 9.0
```

Returns an iterator over the string.

The iterator will yield the substrings of length 1 in order.

```ballerina
object {
  public isolated function next() returns record {|string:Char value;|}?;
} iterator = "Hello, World!".iterator();
iterator.next() ⇒ {"value":"H"}
```

Enables the deadline by adding the `deadline` header to the given headers.
```ballerina
time:Utc current = time:utcNow();
time:Utc deadline = time:utcAddSeconds(current, 300);
map<string|string[]> headers = grpc:setDeadline(deadline);
```

Returns the header value with the specified header name. If there are more than one header values for the
specified header name, the first value is returned.
```ballerina
map<string|string[]> headerMap = request.headers;
string|grpc:Error result = grpc:getHeader(headerMap, "content-type");
```

Gets all the transport headers with the specified header name.
```ballerina
map<string|string[]> headerMap = request.headers;
string[]|grpc:Error result = grpc:getHeaders(headerMap, "content-type");
```

Returns the sum of zero or more decimal values.

```ballerina
decimal:sum(1.2, 2.3, 3.4) ⇒ 6.9
decimal[] scores = [11.1, 22.2, 33.3];
decimal:sum(...scores) ⇒ 66.6
[decimal, decimal, decimal] marks = [7.21, 10.32, 9.2];
decimal:sum(...marks) ⇒ 26.73
decimal d = 21.2;
d.sum(10.5, 21, 32.4) ⇒ 85.1
```

Returns the maximum of one or more decimal values.

```ballerina
decimal:max(1.2, 12.3, 3.4) ⇒ 12.3
decimal[] marks = [70.3, 80.5, 98.1, 92.3];
decimal:max(30.5, ...marks) ⇒ 98.1
[decimal, decimal, decimal] scores = [7.21, 10.32, 9.2];
decimal:max(...scores) ⇒ 10.32
decimal d = 21.2;
d.max(40.5, 21, 32.4) ⇒ 40.5
```

Returns the minimum of one or more decimal values.

```ballerina
decimal:min(5.2, 2.3, 3.4) ⇒ 2.3
decimal[] marks = [90.3, 80.5, 98, 92.3];
decimal:min(82.1, ...marks) ⇒ 80.5
[decimal, decimal, decimal] scores = [7.21, 10.32, 9.2];
decimal:min(...scores) ⇒ 7.21
decimal d = 1.2;
d.min(10.5, 21, 32.4) ⇒ 1.2
```

Asserts whether the given condition is true. If it is not, a AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
 @test:Config {}
 function testAssertTrue() {
     boolean value = false;
     test:assertTrue(value, msg = "AssertTrue failed");
 }
```

Asserts whether the given condition is false. If it is not, a AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
 @test:Config {}
 function testAssertFalse() {
     boolean value = false;
     test:assertFalse(value, msg = "AssertFalse failed");
 }
```

Asserts whether the given values are equal. If it is not, an AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
@test:Config {}
 function testAssertIntEquals() {
     int answer = intAdd(5, 3);
     test:assertEquals(answer, 8, msg = "IntAdd function failed");
 }
 function intAdd(int a, int b) returns (int) {
     return (a + b);
 }
```

Asserts whether the given values are not equal. If it is equal, an AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
 @test:Config {}
 function testAssertIntEquals() {
     int answer = intAdd(5, 3);
     test:assertNotEquals(answer, 8, msg = "Matches");
 }
 function intAdd(int a, int b) returns (int) {
     return (a + b);
 }
```

Asserts whether the given values are exactly equal. If it is not, an AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
 class Person {
     public string name = "";
     public int age = 0;
     public Person? parent = ();
     private string email = "default@abc.com";
     string address = "No 20, Palm grove";
 }
 @test:Config {}
 function testAssertExactEqualsObject() {
     Person p1 = new;
     Person p2 = p1;
     test:assertExactEquals(p1, p2, msg = "Objects are not exactly equal");
 }
```

Asserts whether the given values are not exactly equal. If it is equal, an AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
class Person {
     public string name = "";
     public int age = 0;
     public Person? parent = ();
     private string email = "default@abc.com";
     string address = "No 20, Palm grove";
 }
 @test:Config {}
 function testAssertNotExactEqualsObject() {
     Person p1 = new;
     Person p2 = new ();
     test:assertNotExactEquals(p1, p2, msg = "Objects are exactly equal");
 }
```

Assert failure is triggered based on your discretion. AssertError is thrown with the given errorMessage.

### Example
```ballerina
import ballerina/test;
 @test:Config {}
 function foo() {
     error? e = trap bar(); // Expecting `bar()` to panic
     if e is error {
         test:assertEquals(e.message().toString(), "Invalid Operation", msg = "Invalid error reason");
     } else {
         test:assertFail(msg = "Expected an error");
     }
 }
 function bar() {
     panic error("Invalid Operation");
 }
```

Converts YAML string to subtype of anydata.

```ballerina
json value = yaml:parseString("name: Ballerina");
value ⇒ {"name": "Ballerina"}
```

Converts YAML byte[] to subtype of anydata.

```ballerina
byte[] content = "name: Ballerina".toBytes();
json value = yaml:parseBytes(content);
value ⇒ {"name": "Ballerina"}
```

Converts YAML byte-block-stream to subtype of anydata.

```ballerina
stream<byte[], error?> content = getStream();
json value = yaml:parseStream(content);
value ⇒ {"name": "Ballerina"}
```

Returns an iterator over an array.

```ballerina
object {
    public isolated function next() returns record {|int value;|}?;
} iterator = [2, 4, 6, 8].iterator();
iterator.next() ⇒ {"value":2}
```

Applies a function to each member of an array.

The parameter `func` is applied to each member of parameter `arr` in order.

```ballerina
int total = 0;
[1, 2, 3].forEach(function (int i) {
    total += i;
});
total ⇒ 6
```

Removes all members of an array.

Panics if any member cannot be removed.

```ballerina
int[] numbers = [2, 4, 6, 8];
numbers.removeAll();
numbers ⇒ []
int[2] values = [1, 2];
values.removeAll() ⇒ panic
```

Changes the length of an array.

`setLength(arr, 0)` is equivalent to `removeAll(arr)`.

```ballerina
int[] numbers = [2, 4, 6, 8];
numbers.setLength(2);
numbers ⇒ [2,4]
numbers.setLength(0);
numbers ⇒ []
```

Adds values to the end of an array.

```ballerina
int[] numbers = [2];
numbers.push(4, 6);
numbers ⇒ [2,4,6]
int[] moreNumbers = [8, 10, 12, 14];
numbers.push(...moreNumbers);
numbers ⇒ [2,4,6,8,10,12,14]
```

Adds values to the start of an array.

The values newly added to the array will be in the same order
as they are in parameter `vals`.

```ballerina
int[] numbers = [14];
numbers.unshift(10, 12);
numbers ⇒ [10,12,14]
int[] moreNumbers = [2, 4, 6, 8];
numbers.unshift(...moreNumbers);
numbers ⇒ [2,4,6,8,10,12,14]
```

Returns a stream from the given array.

```ballerina
stream<string> strm = ["a", "b", "c", "d"].toStream();
strm.next() ⇒ {"value":"a"}
```

